/**
 * Wrap the given {@link BitSet} as a {@link DocIdSet}. The provided
 * {@link BitSet} must not be modified afterwards.
 */
public BitDocIdSet(BitSet set, long cost) {
  if (cost < 0) {
    throw new IllegalArgumentException("cost must be >= 0, got " + cost);
  }
  this.set = set;
  this.cost = cost;
}

